import React from "react";
import styled from "styled-components";
import QR from "../../assets/qr.png";
import Transfer from "../../assets/transfer.png";
import BankTransfer from "../../assets/bank.png";
// import QR from "../../assets/qr.png";

export default function MiddleScan() {
  return (
    <>
      <MiddleFirst>
        <EachMiddle>
          <EachMiddleImgCont>
            <img src={QR} alt="QR" />
          </EachMiddleImgCont>
          <P>
            Scan any <br /> QR code
          </P>
        </EachMiddle>
        <EachMiddle>
          <EachMiddleImgCont>
            <img src={Transfer} alt="Transfer" />
          </EachMiddleImgCont>
          <P>
            Send <br /> money
          </P>
        </EachMiddle>
        <EachMiddle>
          <EachMiddleImgCont>
            <img src={BankTransfer} alt="Bank Transfer" />
          </EachMiddleImgCont>
          <P>
            Bank <br /> Transfer
          </P>
        </EachMiddle>
        <EachMiddle>
          <EachMiddleImgCont>
            <img src={QR} alt="QR" />
          </EachMiddleImgCont>
          <P>
            Recharge <br /> and bills
          </P>
        </EachMiddle>
      </MiddleFirst>
    </>
  );
}

const MiddleFirst = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  text-align: center;
  font-size: 12px;
  padding: 10px 0;
  margin: 0 20px;
`;
const EachMiddle = styled.div``;
const EachMiddleImgCont = styled.div`
  background-color: #d6efff;
  padding: 10px;
  border-radius: 10px;
  margin-bottom: 5px;
`;
const P = styled.p`
  color: black;
  line-height: 16px;
`;
